
SET FOREIGN_KEY_CHECKS=0;
-- ----------------------------
-- Table structure for mobs
-- ----------------------------
CREATE TABLE `mobs` (
  `id` int(10) unsigned NOT NULL,
  `sprite_name` varchar(24) NOT NULL,
  `name` varchar(24) NOT NULL,
  `range` tinyint(3) unsigned NOT NULL,
  `LV` tinyint(3) unsigned NOT NULL,
  `HP` int(10) unsigned NOT NULL DEFAULT '0',
  `SP` int(10) unsigned NOT NULL DEFAULT '0',
  `str` smallint(5) unsigned NOT NULL DEFAULT '0',
  `int` smallint(5) unsigned NOT NULL DEFAULT '0',
  `vit` smallint(5) unsigned NOT NULL DEFAULT '0',
  `dex` smallint(5) unsigned NOT NULL DEFAULT '0',
  `agi` smallint(5) unsigned NOT NULL DEFAULT '0',
  `luk` smallint(5) unsigned NOT NULL DEFAULT '0',
  `attack_rating_min` smallint(6) unsigned NOT NULL DEFAULT '0',
  `attack_rating_max` smallint(6) unsigned NOT NULL DEFAULT '0',
  `def` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `exp` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `jexp` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `inc` mediumint(4) unsigned NOT NULL,
  `as` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `es` tinyint(4) unsigned NOT NULL DEFAULT '0',
  `move_speed` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `rechargeTime` int(10) unsigned NOT NULL,
  `attackedmt` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `attackmt` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `property` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `scale` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `class` mediumint(4) unsigned NOT NULL DEFAULT '0',
  `race` smallint(6) unsigned NOT NULL DEFAULT '0',
  `mdef` smallint(6) unsigned NOT NULL DEFAULT '0',
  `taming_item` smallint(6) unsigned NOT NULL DEFAULT '0',
  `food_item` smallint(6) unsigned NOT NULL DEFAULT '0',
  KEY `id` (`id`),
  KEY `name` (`sprite_name`,`name`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

